import styled from 'styled-components'



const Title = styled.h2`
color: #fff;
font-weight: 300;
`

const Date = styled.div`
color: #ccc;
font-weight: 300;
margin: 6px 0;
`

const Description = styled.p`
color: #fff;
font-weight: 300;
`


export class Card extends Component {
    render() {
        return (
            <div>
                   <Title>spiderma</Title>
            <Date>2020</Date>
            <Description>beinbeinbeinbeinbeinbeinbeinbeinbeinbeinbeinbeinbeinbeinbeinbeinbein</Description>
            </div>
        )
    }
}

export default Card
